def get_mongo_client():
    # Connect to the MongoDB server, adjust the connection string as needed
    client = MongoClient('mongodb://localhost:27017/')
    return client


# Formulate the data to be inserted into MongoDB
def create_point_data(point):
    # Determine road name based on 'tag'
    if int(point['tag']) >= 1000:
        road_name = "MichiganSTATE " + point['name']
    else:
        road_name = "MichiganCOUNTY " + point['name']

    # Construct the dictionary to be inserted into MongoDB
    point_data = {
        'user_id': 6,
        'username': "mohotavakoli",
        'latitude': point['lat'],
        'longitude': point['lon'],
        'road_name': road_name,
        'road_type': point['name'],
        'winter_maintenance': True,
        'operation_plowing': True,
        'operation_salting': True,
        'salt_type': 'salt',
        'plowing_per_day': 2,
        'salting_per_day': 2,
        'share_point': True,
    }
    return point_data


# Connecting to MongoDB
client = get_mongo_client()
db = client['SmartMDSS_data']
collection = db['User_input_point']

# Inserting the data into the MongoDB collection
for point in Initial_data:
    point_data = create_point_data(point)
    collection.insert_one(point_data)

print("Data has been successfully inserted into MongoDB.")